import './Search.css'

class SearchListCard extends React.Component {
    state = { 

    }
    handleAddToPlaylist = (e) => {

    }
    handleFavorite = (e) => {

    }
    render() {
        const { item } = this.props;

        return (
            <div>
                <div className='card z-depth-0 grey row'>
                    <div className='card-content col s3 text'>
                        <span className='card-title'>{item.song_title}</span>
                    </div>
                    <div className='card-content col s3 text'>
                        <span className='card-title'>{item.artist}</span>
                    </div>
                    <div className='card-content col s3 text'>
                        <span className='card-title'>{item.song_length}</span>
                    </div>
                    <div className='card-content col s3 text'>
                        <a className="btn-floating red" onClick={this.handleFavorite}><i className='material-icons'>favorite</i></a>
                        <a className="btn-floating black" onClick={this.handleAddToPlaylist}><i className='material-icons'>add_circle</i></a>
                    </div>
                </div>
            </div>
        );
    }
}
export default SearchListCard;
